function Register(props) {
    const [formParams, setFormParams] = useState({
        email: "",
        password: "",
      });

      function handleChange(evt) {
        const { name, value } = evt.target;
        setFormParams((prev) => ({
          ...prev,
          [name]: value,
        }));
      }

      function handleSubmit(evt) {
        evt.preventDefault();
        props.handleRegister(formParams);
      }

return (
    <>
    <header className='header'>
        <div className='header__logo'></div>
        <link to='/sign-in' className='header__nav-link'>Войти</link>
    </header>
    <form className="entry-form" onSubmit={handleSubmit}>
        <h2 className="entry-form__title">Регистрация</h2>
        <input
          value={formParams.email}
          onChange={handleChange}
          name="email"
          type="email"
          className="entry-form__input"
          placeholder="Email"
          autoComplete="off"
        ></input>
        <span className="entry-form__input-error"></span>
        <input
          value={formParams.password}
          onChange={handleChange}
          name="password"
          type="password"
          className="entry-form__input"
          placeholder="Пароль"
          autoComplete="off"
        ></input>
        <span className="entry-form__input-error"></span>
        <button type="submit" className="entry-form__button">
          Зарегистрироваться
        </button>
        <div className="register-signin">
          <p className="register-signin__p">Уже зарегистрированы?</p>

        </div>
      </form>

    </>
);
}

export default Register;
